            cout << c << " is a letter!" << endl;
        }
        else if(isdigit(c)){
            cout << c << " is a digit!" << endl;
        }
        else if(ispunct(c)){
            cout << c << " is a punctuation character!" << endl;
        }
    }

    return 0;
}

